import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  containerConfig: {
    backgroundColor:"#FFF2D8"
  },
  navConfig:{
    backgroundColor:'#d5ecb4'
  },
  inputConfig:{
    backgroundColor:'white',
    width:'100px',
    outlined:'gray'
  },
  buttonConfig1:{
    backgroundcolor:'#d5ecb4'
  },
  buttonConfig2:{
    backgroundColor:'red'
  },
  buttonConfig3:{
    backgroundColor:'F1C4A5'
  }
});
